import React from 'react';
import './App.css';


class App extends React.Component {

    render() {
        return (
            <div>
                {headingTitle}
                {formComponent()}
            </div>)
    }
}

const headingTitle = <h1>SignUp Page</h1>;

function formComponent() {
    return (
        <div>
            <form>
                {inputComponent({txt: "enter your name her"})}
                {inputComponent({txt: "email here"})}
                {Button}
            </form>

        </div>
    );

}

const Button = (
    <button>
        Sign Up
    </button>
);
const inputComponent = (props) => <div>
    <input type="text" value={props.txt}/>
</div>;

export default App;
